INSERT INTO `mdl_question` VALUES (2,12,0,'TEA 2017 - Q1 - 3.5(A) (Old) round whole numbers to the nearest ten or hundred to approximate reasonable results in problem situations','<p><p>An art teacher had 736 crayons.<span style=\"font-size: 0.9375rem;\">&nbsp;</span></p><p>• She threw away 197 broken crayons.<br><span style=\"font-size: 0.9375rem;\">• Then she bought 150 more crayons.</span></p><p>&nbsp;<span style=\"font-size: 0.9375rem;\">Which equation shows how to find the number of crayons the art teacher has now?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200625155521+9LFIFE','upliftk12.com+200625155746+DcrqXN',0,1593100521,1593100666,2,2,NULL),(3,22,0,'TEA 2017 - #1 - 4.2(G) relate decimals to fractions that name tenths and hundredths','<p>Larry has written&nbsp;<img src=\"https://intervene.io/images/Gr%2004%202017_1.PNG\" alt=\"\" width=\"25\" height=\"35\">&nbsp;of his book report. Which decimal represents the part of the book report he has written?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200625171623+iCZyMy','upliftk12.com+200625171623+KC8hWI',0,1593105383,1593105383,2,2,NULL),(4,22,0,'TEA 2017 - #3 - 4.2(B) represent the value of the digit in whole numbers','<p><p>Quinlyn described a number using these clues.</p><p>•The value of the digit 7 is (7 × 10).<br>•The value of the digit 3 is (3 × 1,000).<br>•The value of the digit 1 is (1 × 100).</p><p>Which number could fit Quinlyn’s description?</p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200625171955+FFPuO7','upliftk12.com+200625171955+RXpSWe',0,1593105595,1593105595,2,2,NULL),(5,22,0,'TEA 2017 - #5 - 4.6(D) classify two-dimensional figures','<p><p>Ruth sorted polygons into groups. The polygons shown belong in the same group.</p><p>&nbsp;<img src=\"https://intervene.io/images/Gr%2004%202017_5_1.PNG\" alt=\"\" width=\"331\" height=\"96\" style=\"font-size: 0.9375rem;\"></p><p>Which description best represents this group?</p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200625174545+JCFgzf','upliftk12.com+200625174545+6Hl9oH',0,1593107145,1593107145,2,2,NULL),(6,22,0,'TEA 2017 - #6 - 4.3(E) represent and solve addition and subtraction of fractions','<p><p>On Monday, Pete and Ted completed a total of of&nbsp;<img src=\"https://intervene.io/images/Gr%2004%202016_1.PNG\" alt=\"\" width=\"24\" height=\"31\">&nbsp;their group project. Pete completed&nbsp;&nbsp;<img src=\"https://intervene.io/images/Gr%2004%202016_2.PNG\" alt=\"\" width=\"20\" height=\"32\">&nbsp;of the project.</p><p><img src=\"https://intervene.io/images/Gr%2004%202016.PNG\" alt=\"\" width=\"370\" height=\"42\"></p><p>What fraction of the group project did Ted complete on Monday?</p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200625174808+HQS17H','upliftk12.com+200625174808+VN3csl',0,1593107288,1593107288,2,2,NULL),(7,22,0,'TEA 2017 - #7 - 4.2(D)','<p>Scott traveled 557 miles to visit his cousin. What is this number rounded to the nearest ten?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200625175058+Bvdk8e','upliftk12.com+200625175058+9LqtLP',0,1593107458,1593107458,2,2,NULL),(8,12,0,'TEA 2017 - Q2 - 3.7(A) represent fractions of halves, fourths, and eighths as distances from zero on a number line','<p><p>The number line represents a distance of 1 foot.<span style=\"font-size: 0.9375rem;\">&nbsp;</span></p><p><img src=\"data:image/png;base64,\" alt=\"\" width=\"253\" height=\"52\"></p><p>&nbsp;<span style=\"font-size: 0.9375rem;\">On which of these number lines does point&nbsp;</span><em style=\"font-size: 0.9375rem;\">H</em><span style=\"font-size: 0.9375rem;\">&nbsp;represents&nbsp;</span><img src=\"https://intervene.io/images/onehalf.png\" alt=\"\" width=\"18\" height=\"28\" style=\"font-size: 0.9375rem;\"><span style=\"font-size: 0.9375rem;\">&nbsp;foot?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200625175331+DbMPeO','upliftk12.com+200625175331+cf8ZTW',0,1593107611,1593107611,2,2,NULL),(9,22,0,'TEA 2017 - #8 - 4.5(D)','<p><p>Bonnie has a rectangular picture of her dog. Use the ruler provided to measure the length and width of the picture to the nearest inch.</p><p><img src=\"https://intervene.io/images/gr%2004%202016.PNG\" alt=\"\" width=\"214\" height=\"356\" style=\"font-size: 0.9375rem;\"></p><p><span style=\"font-size: 0.9375rem;\">Which measurement is closest to the area of the picture in square inches?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200625175557+W49Rax','upliftk12.com+200625175557+GKUHU5',0,1593107757,1593107757,2,2,NULL),(10,12,0,'TEA 2017 - Q3 - 3.6(C) determine the area of rectangles with whole number side lengths in problems using multiplication related to the number of rows times the number of unit squares in each row','<p><p>A model of a rectangular bulletin board is shown. The top row has been divided into squares of equal size.<span style=\"font-size: 0.9375rem;\">&nbsp;</span></p><p><img src=\"https://intervene.io/images/Gr%2003%202017_03.PNG\" alt=\"\" width=\"200\" height=\"128\"></p><p><span style=\"font-size: 0.9375rem;\">The rest of the model will also be divided into squares of the same size. What is the area in square units represented by this model?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200625180042+AFVamj','upliftk12.com+200625180042+hod9ub',0,1593108042,1593108042,2,2,NULL),(11,22,0,'TEA 2017 - #9 - 4.5(B) represent problems using an input-output table','<p>The rule +38 is used to show the relationship between the position of a number in a pattern and the value of that number. Which table shows this relationship?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200625180215+HZaMbK','upliftk12.com+200625180215+CD1Ufx',0,1593108135,1593108135,2,2,NULL),(12,12,0,'TEA 2017 - Q4- 3.4(C) determine the value of a collection of coins and bills','<p>Inez did laundry. She found $6.47 in the pocket of her dad’s pants. Which of the following could NOT represent the amount of money Inez found?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200625180626+bZcUgu','upliftk12.com+200625180626+76WPGE',0,1593108386,1593108386,2,2,NULL),(13,22,0,'TEA 2017 - #10 - 4.7(C) determine the approximate measures of angles','<p>Which angle does NOT appear to have a measure of 23°?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200625181142+NziUhC','upliftk12.com+200625181142+WxYaRa',0,1593108702,1593108702,2,2,NULL),(14,12,0,'TEA 2017 - Q4 - 3.5(A) (Old) round whole numbers to the nearest ten or hundred to approximate reasonable results in problem situations','<p></p><p>Rita had two boxes of ribbons.<span style=\"font-size: 0.9375rem;\">&nbsp;</span></p><p>•She had 37 large ribbons in the first box.<br>•She had 56 small ribbons in the second box.<br>•She gave 28 of the large ribbons to her sister.</p><p>&nbsp;<span style=\"font-size: 0.9375rem;\">Which number sentence can be used to find the number of ribbons Rita had left in the two boxes?</span></p><p>&nbsp;</p><br><p></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200625181319+9Yuk4H','upliftk12.com+200625181320+3NmYDs',0,1593108799,1593108799,2,2,NULL),(15,22,0,'TEA 2017 - #11 - 4.5(A)represent multi-step problems involving the four operations with whole numbers using strip diagrams and equations with a letter standing for the unknown quantity','<p><p>It took Ian three years to collect 25,413 aluminum cans to recycle. In the first year he collected 8,917 cans, and in the second year he collected 7,639 cans.<br><span style=\"font-size: 0.9375rem;\"><br>Which equation can be used to find x, the number of cans Ian collected in the third year?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200625181436+rV9eFG','upliftk12.com+200625181436+zAw1lf',0,1593108876,1593108876,2,2,NULL),(16,22,0,'TEA 2017 - #12