INSERT INTO `mdl_question_attempts` VALUES (1,1,1,'deferredfeedback',2,1,1.0000000,0.0000000,1.0000000,0,'An art teacher had 736 crayons. \n\n• She threw away 197 broken crayons.\n• Then she bought 150 more crayons.\n\n Which equation shows how to find the number of crayons the art teacher has now?\n\n: ; ; ; ','',NULL,1593100530),(2,2,1,'deferredfeedback',8,1,1.0000000,0.0000000,1.0000000,0,'The number line represents a distance of 1 foot. \n\n On which of these number lines does point _H_ represents  foot?\n\n: ; ; ; ','',NULL,1593107619),(3,3,1,'deferredfeedback',52,1,1.0000000,0.0000000,1.0000000,0,'A band plays 8 songs at every show. Last year the band had 8 shows. Which model can be used to find the number of songs the band played at shows last year?\n\n: ; ; ; ','',NULL,1593121976),(4,4,1,'deferredfeedback',2,1,1.0000000,0.0000000,1.0000000,0,'An art teacher had 736 crayons. \n\n• She threw away 197 broken crayons.\n• Then she bought 150 more crayons.\n\n Which equation shows how to find the number of crayons the art teacher has now?\n\n: ; ; ; ','',NULL,1593154763),(5,4,2,'deferredfeedback',8,1,1.0000000,0.0000000,1.0000000,0,'The number line represents a distance of 1 foot. \n\n On which of these number lines does point _H_ represents  foot?\n\n: ; ; ; ','',NULL,1593154763),(6,4,3,'deferredfeedback',10,1,1.0000000,0.0000000,1.0000000,0,'A model of a rectangular bulletin board is shown. The top row has been divided into squares of equal size. \n\nThe rest of the model will also be divided into squares of the same size. What is the area in square units represented by this model?\n\n: 8 square units\n\n; 12 square units\n\n; 16 square units\n\n; 15 square units\n\n','15 square units\n\n',NULL,1593154763),(7,4,4,'deferredfeedback',12,1,1.0000000,0.0000000,1.0000000,0,'Inez did laundry. She found $6.47 in the pocket of her dad’s pants. Which of the following could NOT represent the amount of money Inez found?\n\n: ; ; ; ','',NULL,1593154763),(8,4,5,'deferredfeedback',14,1,1.0000000,0.0000000,1.0000000,0,'Rita had two boxes of ribbons. \n\n•She had 37 large ribbons in the first box.\n•She had 56 small ribbons in the second box.\n•She gave 28 of the large ribbons to her sister.\n\n Which number sentence can be used to find the number of ribbons Rita had left in the two boxes?\n\n \n\n: ; ; ; ','',NULL,1593154763),(9,4,6,'deferredfeedback',17,1,1.0000000,0.0000000,1.0000000,0,'The frequency table shows the results of a survey about how many days per week some families eat dessert. \n\n Which dot plot represents the data in the table?\n\n: ; ; ; ','',NULL,1593154763),(10,4,7,'deferredfeedback',18,1,1.0000000,0.0000000,1.0000000,0,'Aaron will place 99 towels on a shelf.  He will make 9 equal stacks.  How many towels will be in each stack?\n\n: 11\n\n; 90\n\n; 12\n\n; Not Here\n\n','11\n\n',NULL,1593154763),(11,4,8,'deferredfeedback',21,1,1.0000000,0.0000000,1.0000000,0,'These six basketball jerseys are hanging on a wall. Lori’s favorite basketball players each have an odd number on their jerseys. \n\n Which list shows only the numbers of Lori’s favorite basketball players?\n\n: 21, 25, 33\n\n; 21, 50, 52\n\n; 10, 33 ,50, 52\n\n; 10, 21, 25, 33\n\n','21, 25, 33\n\n',NULL,1593154763),(12,4,9,'deferredfeedback',23,1,1.0000000,0.0000000,1.0000000,0,'Erika’s goal is to practice playing her guitar for 300 minutes this week.\n\n• On Sunday she practiced for 117 minutes.\n\n• On Tuesday she practiced for 58 minutes.\n\nHow many more minutes does Erika need to practice in order to meet her goal?\n\n: 125 minutes\n\n; 235 minutes\n\n; 175 minutes\n\n; 475 minutes\n\n','125 minutes\n\n',NULL,1593154763),(13,4,10,'deferredfeedback',24,1,1.0000000,0.0000000,1.0000000,0,'Zayne sorted some figures into two groups.\n\n Which statement about the figures Zayne sorted is true?\n\n: All the figures in Group Y are rectangular prisms.\n\n; All the figures in Group X are cylinders.\n\n; All the figures in Group Y are prisms.\n\n; All the figures in Group X are cones.\n\n','All the figures in Group Y are prisms.\n\n',NULL,1593154763),(14,4,11,'deferredfeedback',25,1,1.0000000,0.0000000,1.0000000,0,'Gina has 42 mushrooms to put into 6 salads. She wants to put the same number of mushrooms in each salad.  Which strip diagram shows how to find the number of mushrooms that Gina should put in each salad?\n\n: ; ; ; ','',NULL,1593154763),(15,4,12,'deferredfeedback',26,1,1.0000000,0.0000000,1.0000000,0,'Felicia started placing square tiles inside a rectangle, as shown in the diagram. Each square tile has a side length of 1 cm. \n\n What is the area of the rectangle in square centimeters?\n\n: 22\n\n; 32\n\n; 28\n\n; Not here\n\n','28\n\n',NULL,1593154763),(16,4,13,'deferredfeedback',27,1,1.0000000,0.0000000,1.0000000,0,'The models shown are the same size and are each divided into equal parts. The models are shaded to show two fractions. \n\n Based on the models, which statement is true?\n\n: ; ; ; ','',NULL,1593154763),(17,4,14,'deferredfeedback',28,1,1.0000000,0.0000000,1.0000000,0,'A baseball league bought 9 boxes of baseballs. Each box contained 36 baseballs. How many baseballs did the league buy?\n\n: 84\n\n; 324\n\n; 34\n\n; 274\n\n','324\n\n',NULL,1593154763),(18,4,15,'deferredfeedback',29,1,1.0000000,0.0000000,1.0000000,0,'The table shows the land areas of some states.\n\n Which comparison of two land areas is NOT true?\n\n: The land area of Alabama > the land area of Mississippi.\n\n; The land area of Oklahoma > the land area of Louisiana.\n\n; The land area of Louisiana < the land area of Mississippi.\n\n; The land area of Arkansas < the land area of Alabama.\n\n','The land area of Arkansas < the land area of Alabama.\n\n',NULL,1593154763),(19,4,16,'deferredfeedback',30,1,1.0000000,0.0000000,1.0000000,0,'Holly made a poster using two congruent pentagons and a square. \n\n What is the perimeter of the poster in inches?\n\n: 196\n\n; Not Here\n\n; 118\n\n; 169\n\n','196\n\n',NULL,1593154763),(20,4,17,'deferredfeedback',31,1,1.0000000,0.0000000,1.0000000,0,'Kacie sold bracelets at a store. She sold 3 bracelets for 1 dollar.  Which table represents the numbers of bracelets that would be sold for different numbers of dollars?\n\n: ; ; ; ','',NULL,1593154763),(21,4,18,'deferredfeedback',32,1,1.0000000,0.0000000,1.0000000,0,'Which of these describes the number 35,824?\n\n: The sum of three thousands, five thousands, eight hundreds, two tens, and four ones.\n\n; The sum of five ten thousands, three thousands, eight hundreds, two tens, and four ones.\n\n; The sum of three ten thousands, five thousands, eight hundreds, two tens, and four ones.\n\n; The sum of thirty-five hundreds, eight tens, and twenty-four ones.\n\n','The sum of three ten thousands, five thousands, eight hundreds, two tens, and four ones.\n\n',NULL,1593154763),(22,4,19,'deferredfeedback',33,1,1.0000000,0.0000000,1.0000000,0,'Kevin and his two brothers ate a bowl of grapes.  There were 27 grapes in the bowl.  Each boy ate the same number of grapes.  What is the number of grapes each boy ate?\n\n: 9\n\n; 54\n\n; 7\n\n; 81\n\n','9\n\n',NULL,1593154763),(23,4,20,'deferredfeedback',34,1,1.0000000,0.0000000,1.0000000,0,'Debra and Shelly started running a race at 9:00 A.M. Debra finished in 45 minutes.\n\n Shelly finished the race 20 minutes after Debra did. Which clock shows the time Shelly finished the race?\n\n: ; ; ; ','',NULL,1593154763),(24,4,21,'deferredfeedback',35,1,1.0000000,0.0000000,1.0000000,0,'The table shows the numbers of puzzle pieces in four puzzles. Derek put together the two puzzles that had the greatest numbers of pieces. \n\n What is the total number of pieces in these two puzzles?\n\n: 961\n\n; Not here\n\n; 861\n\n; 900\n\n','Not here\n\n',NULL,1593154763),(25,4,22,'deferredfeedback',36,1,1.0000000,0.0000000,1.0000000,0,'Eddie marked the fraction  with a star on the number line shown. \n\nWhich of these number lines shows a fraction equivalent to  marked with a star?\n\n: ; ; ; ','',NULL,1593154763),(26,4,23,'deferredfeedback',37,1,1.0000000,0.0000000,1.0000000,0,'A classroom currently contains 6 rows of chairs with 5 chairs per row. On parents\' night, the classroom had twice as many chairs. Which number sentence can be used to find the number of chairs in the classroom on parents’ night?\n\n: ; ; ; ','',NULL,1593154763),(27,4,24,'deferredfeedback',38,1,1.0000000,0.0000000,1.0000000,0,'Each rectangle shown will be covered with equal-size squares. Some of the squares have been placed as shown. \n\n Which of these rectangles have an area of 36 square centimeters?\n\n: Rectangles V, W, X, Y, and Z\n\n; Rectangles X and Y only\n\n; Rectangles V, X, and Y only\n\n; Rectangles W and Z only\n\n','Rectangles V, X, and Y only\n\n',NULL,1593154763),(28,4,25,'deferredfeedback',39,1,1.0000000,0.0000000,1.0000000,0,'Scott has 28 toy cars to put on 4 shelves. He wants to put the same number of cars on each shelf. How many toy cars should Scott put on each shelf?\n\n: 24, because 28 - 24 = 4\n\n; 32, because 4 + 28 = 32\n\n; 112, because 28 x 4 =112\n\n; 7, because 4 x 7 = 28\n\n','7, because 4 x 7 = 28\n\n',NULL,1593154763),(29,4,26,'deferredfeedback',40,1,1.0000000,0.0000000,1.0000000,0,'To make posters, 6 students each collected 8 pictures of animals. The students put 4 animal pictures on each poster they made. Which equation shows one way to find the number of posters the students made?\n\n: 6 × 8 × 4 = 192\n\n; 6 + 8 − 4 = 10\n\n; 6 + 8 + 4 = 18\n\n; 6 × 8 ÷ 4 = 12\n\n','6 × 8 ÷ 4 = 12\n\n',NULL,1593154763),(30,4,27,'deferredfeedback',41,1,1.0000000,0.0000000,1.0000000,0,'The graph shows the number of rings Mrs. Adams sold during six weeks at her jewelry store. \n\n What is the total number of rings Mrs. Adams sold during weeks 4, 5, and 6?\n\n: Not Here\n\n; 108\n\n; 18\n\n; 201\n\n','108\n\n',NULL,1593154763),(31,4,28,'deferredfeedback',42,1,1.0000000,0.0000000,1.0000000,0,'Mr. Morales gives bonus points when a challenge question on a test is answered correctly. The table shows the relationship between test scores before and after Mr. Morales gives the bonus points. \n\n Which of these describes the relationship shown in the table?\n\n: The test score before bonus points minus 4 equals the test score after bonus points.\n\n; The test score before bonus points plus 4 equals the test score after bonus points.; The test score before bonus points minus 2 equals the test score after bonus points.\n\n; The test score before bonus points plus 2 equals the test score after bonus points.\n\n','The test score before bonus points plus 4 equals the test score after bonus points.',NULL,1593154763),(32,4,29,'deferredfeedback',43,1,1.0000000,0.0000000,1.0000000,0,'In which set do all the figures appear to be either a rhombus, parallelogram, trapezoid, rectangle, or square?\n\n: ; ; ; ','',NULL,1593154763),(33,4,30,'deferredfeedback',44,1,1.0000000,0.0000000,1.0000000,0,'The list shows three clues about a number.\n\n•The number is less than 6,538.\n•The number is greater than 6,355.\n•The number has a digit less than 5 in the hundreds place.\n\nWhich of these could be the number described?\n\n: 6,449\n\n; 6,268\n\n; 6,519\n\n; 6,549\n\n','6,449\n\n',NULL,1593154763),(34,4,31,'deferredfeedback',45,1,1.0000000,0.0000000,1.0000000,0,'Timothy wants to buy a camera that costs $75. He has saved $23, as shown in the model. \n\n Which equation can be used to find how much more money Timothy needs in order to buy the camera?\n\n: ; ; ; ','',NULL,1593154763),(35,4,32,'deferredfeedback',46,1,1.0000000,0.0000000,1.0000000,0,'The bar graph shows the number of third graders who brought lunch to school each day last week. \n\n Which table best represents the data in the graph?\n\n: ; ; ; ','',NULL,1593154763),(36,4,33,'deferredfeedback',47,1,1.0000000,0.0000000,1.0000000,0,'A triangle has a perimeter of 18 units.  Each side of this triangle is the same length.  What is the length of one side of the triangle in units?\n\n: 19 units\n\n; 54 units\n\n; 6 units\n\n; 3 units\n\n','6 units\n\n',NULL,1593154763),(37,4,34,'deferredfeedback',48,1,1.0000000,0.0000000,1.0000000,0,'The point on the number line represents the amount of money needed to build a garage. \n\n Which statement best describes the amount of money needed to build the garage?\n\n: The amount of money needed is about $4,000, because the point is closer to $4,000.\n\n; The amount of money needed is more than $5,000.\n\n; The amount of money needed is less than $4,000.\n\n; The amount of money needed is about $5,000, because the point is closer to $5,000.\n\n','The amount of money needed is about $5,000, because the point is closer to $5,000.\n\n',NULL,1593154763),(38,4,35,'deferredfeedback',49,1,1.0000000,0.0000000,1.0000000,0,'In math class 5 students split up 65 flash cards to practice their math facts. The picture shows the total number of flash cards. Each student took the same number of flash cards. \n\n What is the number of flash cards each student took?\n\n: 60\n\n; 15\n\n; 70\n\n; 13\n\n','13\n\n',NULL,1593154763),(39,4,36,'deferredfeedback',50,1,1.0000000,0.0000000,1.0000000,0,'Donte counted the square tiles on a rectangular floor at his school. Each tile had an area of 1 square foot. On the floor there were 9 rows of tiles and 36 tiles in each row. What is the area of the floor in square feet?\n\n: 90 square feet\n\n; 360 square feet\n\n; 324 square feet\n\n; 45 square feet\n\n','324 square feet\n\n',NULL,1593154763),(40,5,1,'deferredfeedback',106,1,1.0000000,0.0000000,1.0000000,0,'The shaded part of the model represents a fraction. Another fraction was subtracted from the first fraction.\n\n \n\n Which expression does the model represent?\n\n: ; ; ; ','',NULL,1593194825);
