INSERT INTO `mdl_quiz` VALUES (2,9,'2017 Released Test - Algebra 1','<p>Algebra 1 released test</p>',1,0,0,0,'autosubmit',0,'deferredfeedback',0,0,0,1,2,-1,69888,4352,4352,4352,4352,4352,4352,1,'free',1,0.00000,10.00000,0,1592967366,'','','-',0,0,0,0,0,0,0),(3,9,'2018 Released Test -Algebra','<p><h2>2018 Released Test -Algebra&nbsp;</h2><br></p>',1,0,0,0,'autosubmit',0,'deferredfeedback',0,0,0,1,2,-1,69888,4352,4352,4352,4352,4352,4352,1,'free',1,0.00000,10.00000,0,1592967391,'','','-',0,0,0,0,0,0,0),(4,9,'2019 Released Test - Algebra 1','<p><h2>2019 Released Test - Algebra 1<a role=\"button\" data-container=\"body\" data-toggle=\"popover\" data-placement=\"right\" data-content=\"<div class=&quot;no-overflow&quot;><p>The quiz activity enables a teacher to create quizzes comprising questions of various types, including multiple choice, matching, short-answer and numerical.</p>\r\n\r\n<p>The teacher can allow the quiz to be attempted multiple times, with the questions shuffled or randomly selected from the question bank. A time limit may be set.</p>\r\n\r\n<p>Each attempt is marked automatically, with the exception of essay questions, and the grade is recorded in the gradebook.</p>\r\n\r\n<p>The teacher can choose when and if hints, feedback and correct answers are shown to students.</p>\r\n\r\n<p>Quizzes may be used</p>\r\n\r\n<ul><li>As course exams</li>\r\n<li>As mini tests for reading assignments or at the end of a topic</li>\r\n<li>As exam practice using questions from past exams</li>\r\n<li>To deliver immediate feedback about performance</li>\r\n<li>For self-assessment</li>\r\n</ul></div> <div class=&quot;helpdoclink&quot;><a href=&quot;https://docs.moodle.org/38/en/mod/quiz/view&quot;><i class=&quot;icon fa fa-info-circle fa-fw iconhelp icon-pre&quot; aria-hidden=&quot;true&quot;  ></i>More help</a></div>\" data-html=\"true\" tabindex=\"0\" data-trigger=\"focus\"><i title=\"Help with Quiz\" aria-label=\"Help with Quiz\"></i></a></h2><form autocomplete=\"off\" a